from PIL import Image

def int_list_to_binary(int_list, width):
    """
    Converts a list of integers into a list of binary strings (bits).
    Each integer in the list is converted to an 8-bit binary string.
    Automatically pads incomplete rows with 1s to ensure all rows fit the width.
    
    :param int_list: A list of integers (0-255)
    :param width: Width of the image in pixels
    :return: A list of binary values (1 or 0 for each bit)
    """
    binary_list = []
    for num in int_list:
        # Convert each integer to an 8-bit binary string and add to the list
        binary_list.extend([int(bit) for bit in format(num, '08b')])
    
    # Calculate the total number of pixels needed
    total_pixels = len(binary_list)
    rows = (total_pixels + width - 1) // width  # Round up to determine rows
    
    # Calculate padding for the last row
    total_required_pixels = rows * width
    padding = total_required_pixels - total_pixels
    
    # Pad the binary list with 1s
    binary_list.extend([1] * padding)
    
    return binary_list

def binary_to_image(binary_list, width):
    """
    Converts a list of binary values into an image.
    
    :param binary_list: A list of binary values (1 for white, 0 for black)
    :param width: The width of the image in pixels
    :return: PIL Image object
    """
    # Calculate the height of the image
    height = len(binary_list) // width
    
    img = Image.new('1', (width, height))  # '1' mode means black and white (1 bit per pixel)
    pixels = img.load()  # Create pixel map

    index = 0
    for y in range(height):
        for x in range(width):
            pixel_value = 1 if binary_list[index] == 1 else 0  # 1 is white, 0 is black
            pixels[x, y] = pixel_value
            index += 1

    return img

def save_image(int_list, filename='output_image.png', width=104):
    """
    Converts a list of integers to a binary image and saves it.
    The height of the image is calculated automatically based on the width and number of bytes.
    
    :param int_list: List of integers (0-255), each representing 8 bits (1 byte)
    :param filename: Output filename (default 'output_image.png')
    :param width: Width of the image in pixels (must be a multiple of 8)
    """
    # Convert the integer list to a list of binary values, with padding as needed
    binary_list = int_list_to_binary(int_list, width)
    
    # Generate the image
    img = binary_to_image(binary_list, width)
    
    # Save the image to the specified file
    img.save(filename)
    print(f"Image saved as {filename}")

